	(90, '24.90.45.23', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/107.0.0.0 Safari/537.36', '2022-11-24 18:33:01', '/entries', 'POST', '{"entryUrl":"https://github.com/unshakenme/OSPAT","entryTitle":"Open Source Psychedelic-Assisted Therapy Course on GitHub","entryText":"This repository consists of a series of recommended books, articles, interviews, and videos that together cover the majority of what is needed to become a Psychedelic-Assisted Therapist knowledge. While this curriculum cannot currently replace certifications it is meant to be the basis by which others create their own courses from."}'),
