	(194, 90, '2022-11-24 18:33:01', 'Open Source Psychedelic-Assisted Therapy Course on GitHub', 'This repository consists of a series of recommended books, articles, interviews, and videos that together cover the majority of what is needed to become a Psychedelic-Assisted Therapist knowledge. While this curriculum cannot currently replace certifications it is meant to be the basis by which others create their own courses from.', 'https://github.com/unshakenme/OSPAT', 'github.com', 0, 0, 0, 3),
	(195, 115, '2022-11-29 22:36:56', 'Notice of Information on NIMH\'s Considerations for Research Involving Psychedelics and Related Compounds', 'The purpose of this Notice is to outline NIMH priorities and considerations for potential applicants investigating the effects of psychedelic drugs and their derivatives or analogues (i.e., related compounds) on mental health and mental illness.', 'https://grants.nih.gov/grants/guide/notice-files/NOT-MH-23-125.html?utm_source=dlvr.it&utm_medium=twitter', 'nih.gov', 0, 0, 0, 29),
	(196, 115, '2022-11-29 22:39:51', 'Booker, Paul Introduce Bipartisan Legislation to Promote Research and Access to Potential Life Saving Drugs', 'U.S. Senator Cory Booker (D-N.J.) and U.S. Senator Rand Paul (R-KY) introduced the Breakthrough Therapies Act, legislation that would enable the Drug Enforcement Agency (DEA) to make the findings necessary to transfer breakthrough therapies involving Schedule I substances such as MDMA and psilocybin from Schedule I to Schedule II, which could help facilitate a phased roll-out of these potentially lifesaving therapies via FDA-approved Expanded Access pilot programs.', 'https://www.booker.senate.gov/news/press/booker-paul-introduce-bipartisan-legislation-to-promote-research-and-access-to-potential-life-saving-drugs#:~:text=and%20U.S.%20Senator%20Rand%20Paul,Schedule%20II%2C%20which%20could%20help', 'senate.gov', 0, 0, 0, 29),
	(197, 115, '2022-11-29 22:42:38', 'Canada Steps Ahead of U.S. On Psychedelic Drug Legalization', 'Canada was the first country on the North American continent to legalize cannabis. Now the country is on the same path with psychedelics, effectively mirroring the step-by-step psychedelics legalization efforts in the U.S. while moving the needle toward broader legalization ever so slightly.', 'https://www.greenmarketreport.com/canada-steps-ahead-of-u-s-on-psychedelic-drug-legalization/', 'greenmarketreport.com', 0, 0, 0, 29),
	(198, 115, '2022-11-29 22:44:44', 'Is New York on track to legalize magic mushrooms?', '"What we are trying to do is disentangle the hype and hysteria that led to these substances becoming illegal in the first place," Stempel said. "The more we talk about it and are open about how people have been using them — that\'s what I think will help drive the change in the climate."', 'https://www.timesunion.com/news/article/Mushrooms-17564620.php', 'timesunion.com', 0, 0, 0, 29),
	(199, 115, '2022-11-29 22:58:15', 'Could the Latest Science on Psychedelics Revolutionise the Way We Understand Our Minds?', 'Research into psychedelic drugs as a remedy for poor mental health is showing promising results. MH spoke to science writer Jane C Hu, author of The Microdose, about the future of the field', 'https://www.menshealth.com/uk/mental-strength/a41933627/psychedelics-mental-health-care/', 'menshealth.com', 0, 0, 0, 29),
	(200, 115, '2022-11-29 23:01:21', 'Artists Discuss How Psychedelics Influence Their Work', 'Visual artists who incorporate psychedelics into their practices maintain a foundational understanding that there is more to reality than meets the eye.', 'https://hyperallergic.com/782273/artists-discuss-how-psychedelics-influence-their-work/', 'hyperallergic.com', 0, 0, 0, 29),
	(201, 115, '2022-11-29 23:08:33', 'Cybin: A Leading Early-Stage Psychedelics Play', 'Cybin (NYSE:CYBN) is working to develop novel medicines for mental illnesses like depression and alcohol use disorder. There are three components to the bull thesis for buying and holding Cybin stock for the long-term.', 'https://seekingalpha.com/article/4560100-cybin-a-leading-early-stage-psychedelics-play', 'seekingalpha.com', 0, 0, 0, 29),
	(202, 115, '2022-11-29 23:12:07', '10 Most Psychedelic Movies', 'The best psychedelic movies span many genres and styles, united by experimentation, bright colors, and mind-bending narratives. They tend to be nonlinear and feature visual distortion, often intended to subvert the audience\'s idea of reality. The aesthetic is inspired by the warped sensory perceptions of psychoactive drugs, especially LSD.', 'https://collider.com/best-most-psychedelic-movies-according-to-reddit/', 'collider.com', 0, 0, 0, 29),
	(203, 115, '2022-11-29 23:19:47', 'Movie: Have a Good Trip: Adventures in Psychedelics', 'Explore hallucinogenic highs and lows as celebrities share funny, mind-blowing tales via animations, reenactments and more in this documentary.', 'https://www.netflix.com/title/80231917', 'netflix.com', 0, 0, 0, 29),
	(204, 115, '2022-11-29 23:21:37', 'Tune In; Turn On; Figure It Out', '"I believe there is a potential in psychedelic substances to aid people in psychological pain, and for a profoundly human reason."', 'https://www.psychologytoday.com/us/blog/get-out-your-mind/202211/tune-in-turn-figure-it-out', 'psychologytoday.com', 0, 0, 0, 29),
	(205, 115, '2022-11-30 21:26:31', 'Psychedelics in Palliative Care', 'Drugs that foster feelings of uplift and connection can be therapeutic for many conditions in many phases of life', 'https://blogs.scientificamerican.com/observations/psychedelics-in-palliative-care/', 'scientificamerican.com', 0, 0, 0, 100),
	(206, 115, '2022-11-30 21:31:06', 'Dying Patients Are Fighting for Access to Psychedelics', '"If you could provide an option that would provide immediate, sustained relief of depression, anxiety, and lead to a sense of peace as [someone is] going through their final days—why would you not want that as an option?”', 'https://time.com/6208079/psychedelics-psilocybin-access-end-of-life/', 'time.com', 0, 0, 0, 100),
	(207, 115, '2022-11-30 21:34:50', 'I Took A Psychedelic Drug for My Cancer Anxiety. It Changed My Life', '"The feeling of immense love lingered for weeks, and four years later I still feel it at times. My fear and anxiety were completely removed, and they haven’t come back."', 'https://time.com/4586052/psychedelic-drug-psilocybin-cancer-anxiety/', 'time.com', 0, 0, 0, 100),
	(208, 115, '2022-11-30 21:48:58', 'Biomind Receives Approval for a Third Phase II Clinical Trial for Its 5-MeO-DMT Based BMND08 Candidate for Depression & Anxiety in Alzheimer’s Disease', '', 'https://www.linkedin.com/pulse/biomind-receives-approval-third-phase-ii-clinical-trial-/', 'linkedin.com', 0, 0, 0, 100),
	(209, 115, '2022-11-30 21:56:02', 'Microdosed LSD: Finally A Breakthrough For Alzheimer’s Disease?', 'Eleusis is investigating the anti-inflammatory potential of psychedelics as medicines, specifically the application of sub-perceptual doses of LSD in halting the progression of Alzheimer’s disease at its earliest detectable stage. Interview with Shlomi Raz, CEO and founder.', 'https://www.forbes.com/sites/abbierosner/2020/02/21/microdosed-lsd-may-finally-be-the-breakthrough-for-alzheimers-disease/?sh=29e6890853a8', 'forbes.com', 0, 0, 0, 100),
	(210, 115, '2022-11-30 22:18:49', 'Safety, tolerability, pharmacokinetics, and pharmacodynamics of low dose LSD in healthy older volunteers', 'Our results suggest safety and tolerability of orally administered 5 mcg, 10 mcg, and 20 mcg LSD every fourth day over a 21-day period and support further clinical development of LSD for the treatment and prevention of Alzheimer’s disease (AD).', 'https://link.springer.com/article/10.1007/s00213-019-05417-7', 'springer.com', 0, 0, 0, 100);
